INSERT INTO `sys_oper_log` VALUES ('1453393731930681346', '修改系统配置', 'net.foundi.admin.system.controller.ConfigController.edit()', 'PUT', '1', 'admin', '超级管理员,系统管理员', '', '/system/config', '192.168.2.8', '内网IP', '{dto=ConfigDto(id=3000, configTypeDict=0, configKey=userAgreement, configValue=<div><h1>FOUNDi用户协议</h1>\n  <p></p>\n  <p>更新日期：2020年11月19日</p>\n  <p>生效日期：2020年11月26日</p>\n  <p></p><h4>1、导言</h4>\n  <p>欢迎您使用“FOUNDi”及相关服务！</p>\n  <p>\n    “FOUNDi”及相关服务，系指foundi信息技术有限公司（以下简称“公司”）通过合法拥有并运营的、标注名称为“FOUNDi”的客户端应用程序及foundi.top网站，向您提供的产品与服务，包括但不限于个人化推荐、发布信息、搜索查询、互动交流等核心功能及其他功能。《FOUNDi用户协议》（以下简称“本协议”）是您与公司之间就您注册、登录、使用（以下统称“使用”）“FOUNDi”及相关服务所订立的协议。</p>\n  <p>为了更好地为您提供服务，请您在开始使用“FOUNDi”及相关服务之前，务必认真阅读并充分理解本协议，特别是涉及免除或者限制责任的条款、权利许可和信息使用的条款、同意开通和使用特殊单项服务的条款、法律适用和争议解决条款等。<u>其中，免除或者限制责任条款等重要内容将以加粗形式提示您注意，您应重点阅读。</u>如您未满18周岁，请您在法定监护人陪同下仔细阅读并充分理解本协议，并征得法定监护人的同意后使用“FOUNDi”及相关服务。\n  </p>\n  <p><b><u>如您不同意本协议，这将导致我们无法为您提供完整的产品和服务，您也可以选择停止使用。如您自主选择同意或使用</u></b><b><u>“</u></b><u>FOUNDi</u><b><u>”</u></b><u>及相关服务，则视为您已充分理解本协议，并同意作为本协议的一方当事人接受本协议以及其他与</u><b><u>“</u></b><u>FOUNDi</u><b><u>”</u></b><b><u>及相关服务相关的协议和规则（包括但不限于《FOUNDi隐私政策》）的约束。</u></b><u></u></p>\n  <p></p><h4>2、“FOUNDi”及相关服务</h4>\n  <p>2.1 您使用“FOUNDi”及相关服务，可以通过预装、公司已授权的第三方下载等方式获取“FOUNDi”客户端应用程序或访问foundi.top网站。<b><u>若您并非从公司或经公司授权的第三方获取</u></b><u>“</u><b><u>FOUNDi</u></b><b><u>”</u></b><b><u>客户端应用程序或网站的，公司无法保证非官方版本的</u></b><u>“</u><b><u>FOUNDi</u></b><b><u>”</u></b><b><u>客户端应用程序或网站能够正常使用，您因此遭受的损失与公司无关。</u></b>\n  </p>\n  <p>2.2 公司可能为不同的终端设备开发不同的应用程序软件版本，您应当根据实际设备状况获取、下载、安装合适的版本。如您不再使用“FOUNDi”及相关服务，您也可自行卸载相应的应用程序软件。</p>\n  <p>2.3 为更好的提升用户体验及服务，公司将不定期提供“FOUNDi”及相关服务的更新或改变（包括但不限于软件修改、升级、功能强化、开发新服务、软件替换等），您可根据需要自行选择是否更新相应的版本。</p>\n  <p>\n    为保证“FOUNDi”及相关服务安全、提升用户服务，在“FOUNDi”及相关服务的部分或全部更新后，公司将在可行的情况下以妥当的方式（包括但不限于系统提示、公告、站内信等）提示您，您有权选择接受更新后的版本；如您选择不作更新，“FOUNDi”及相关服务的部分功能将受到限制或不能正常使用。</p>\n  <p>2.4 除非得到公司事先书面授权，您不得以任何形式对“FOUNDi”及相关服务进行包括但不限于改编、复制、传播、垂直搜索、镜像或交易等未经授权的访问或使用。</p>\n  <p>2.5\n    您理解，使用“FOUNDi”及相关服务需自行准备与“FOUNDi”及相关服务有