  `group_name` varchar(50) DEFAULT '' COMMENT '用户组名称',
  `oper_url` varchar(2000) DEFAULT '' COMMENT '请求URL',
  `oper_ip` varchar(50) DEFAULT '' COMMENT '主机地址',
